import React, { Component } from 'react'
import axios from 'axios';

class ListMembers extends Component {
    constructor(props) {
        super(props)
        this.state = {members :[]}
    }
    componentDidMount() {
        axios.get(`http://localhost:8092/familytree/member`)
          .then(response => {
            console.log(response.data);
            this.setState({members:response.data})
          }).catch(error =>{
              console.log(error);
          });
      }
      
      render() {
          return (
              <React.Fragment>
                <div align="left">
                <table>
  <tr>
    <th>Company</th>
    <th>Contact</th>
    <th>Country</th>
  </tr>
  <tr>
    <td>Alfreds Futterkiste</td>
    <td>Maria Anders</td>
    <td>Germany</td>
  </tr>
  <tr>
    <td>Centro comercial Moctezuma</td>
    <td>Francisco Chang</td>
    <td>Mexico</td>
  </tr>
  <tr>
    <td>Ernst Handel</td>
    <td>Roland Mendel</td>
    <td>Austria</td>
  </tr>
  <tr>
    <td>Island Trading</td>
    <td>Helen Bennett</td>
    <td>UK</td>
  </tr>
  <tr>
    <td>Laughing Bacchus Winecellars</td>
    <td>Yoshi Tannamuri</td>
    <td>Canada</td>
  </tr>
  <tr>
    <td>Magazzini Alimentari Riuniti</td>
    <td>Giovanni Rovelli</td>
    <td>Italy</td>
  </tr>
</table> 
                <ul className="list-group">
                  {this.state.members.map(member => (
                  <li className="list-group-item list-group-item-primary"  key={member.id}>
                    {member.id} - {member.firstName}   {member.lastName}
                  </li>
                  ))}
                </ul>
                </div>
              </React.Fragment>
          );
        }
}

export default ListMembers;
